          if (preview == 1) {
            data.filePath = filePath + "_modified";
          }

          res.send(data);
        });
      } else if (req.body.processOption === "noise") {
        noiseImage(filePath, parseInt(req.body.standardDev), preview, function () {
          if (preview == 1) {
            data.filePath = filePath + "_modified";
          }

          res.send(data);
        });
      } else if (req.body.processOption === "denoise") {
        // Denoise
        var theta = req.body.theta;

        if (theta >= 0 && theta <= 3) {
          if (preview == 1) {
